import logo from "./logo.svg";
import "./App.css";
import Home from "./Pages/Home";
import Signup from "./Pages/Signup";
import Main from "./Pages/Main";
import NewsTemplate from "./Pages/NewsTemplate";
import {
	BrowserRouter as Router,
	Routes,
	Route,
	Navigate,
	useParams,
} from "react-router-dom";
import { useState } from "react";

function App() {
	const [isSignedIn, setIsSignedIn] = useState(false);

	// function Template() {
	// 	let { flavor } = useParams();
	// 	return <NewsTemplate data={flavor} />;
	// }

	return (
		<Router>
			<Routes>
				<Route path="/" element={<Home />} />
				<Route
					path="/sign-up"
					element={
						<Signup isSignedIn={isSignedIn} setIsSignedIn={setIsSignedIn} />
					}
				/>
				<Route exact path="/main" element={<Main isSignedIn={isSignedIn} />} />
				{/* <Route path="/main/:flavor" element={<Template />} />
				<Route path="/main/:flavor" element={<Template />} />
				<Route path="/main/:flavor" element={<Template />} />
				<Route path="/main/:flavor" element={<Template />} />
				<Route path="/main/:flavor" element={<Template />} />
				<Route path="/main/:flavor" element={<Template />} /> */}
				{isSignedIn ? (
					<Route element={<Navigate to="/main" />} />
				) : (
					<Route element={<Navigate to="/" />} />
				)}
			</Routes>
		</Router>
	);
}

export default App;
